          <p className='card-text2'>QUY HOẠCH KHU ĐÔ THỊ PHÚ MỸ HƯNG CỦA ĐẠI PHÚ MỸ NHẬN GIẢI THƯỞNG QUỐC TẾ TẠI HOA KỲ</p>
