          <p className='card-text'>QUY HOẠCH KHU ĐÔ THỊ PHÚ MỸ HƯNG CỦA ĐẠI PHÚ MỸ NHẬN GIẢI THƯỞNG QUỐC TẾ TẠI HOA KỲ</p>
        </div>
      </div>

    </div>
  );
}

export default Card;
